DELIMITER //
CREATE trigger Generar_codigo_egresos_ahorros before insert on list_fact_ea for each row
begin
	declare siguiente_codigo int;
    set siguiente_codigo = (Select ifnull(max(convert(substring(num_factura, 3), signed integer)), 0) from list_fact_ea) + 1;
    set new.num_factura = concat('EA', LPAD( siguiente_codigo, 8, '0'));
END//
DELIMITER ;
